import Header from "../components/Header";

function ResourcesPage() {
  return (
    <>
      <Header />
      <div style={{ padding: "1rem" }}>
        <h2>Resources Page</h2>
        <p>This is a placeholder for resource-related content.</p>
      </div>
    </>
  );
}

export default ResourcesPage;
